// import logo from './logo.svg';
import './App.css';
// import { userInfo } from 'os';
// import { stringify } from 'querystring';


function Example() {
  const [count, setCount] = useState(0);
  const [isOn, setIsOn] = useState(11);
  useEffect(()=> {
    setIsOn(22)
  })
  return (<div>
  <div onClick={()=>setCount(count+1)}>{count}</div>{isOn}
  </div>
  )
}
function App() {
  return (<div>{Example()}<h1>hello</h1></div>)
}
export default App;
